import React, { Component } from "react";
import "./App.css";
class App extends Component {
  state = {
    todos: [
      {
        id: 1,
        title: "Clean house",
        completed: false,
      },
      {
        id: 2,
        title: "Dinner with wife",
        completed: false,
      },
      {
        id: 3,
        title: "Dinner with mistress",
        completed: false,
      },
    ],
  };
  render() {
    console.log(state.title);
    return <div className="App">ToDoS</div>;
  }
}
export default App;
